import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">

      <nav>
        <ul className="menu">
          <li>ZeProject</li>
          <li><a href="#!">Discover</a></li>
          <li><a href="#!">Live</a></li>
          <li><a href="#!">Contact</a></li>
          <li><a href="#!">Faq</a></li>
        </ul>
      </nav>
      </header>
    </div>
  );
}

export default App;
